        "question": "Determine the proportion of females in each level of education (education-num) who earn more than $50K.",
        "query": "result = df[(df['sex'] == 'Female') & (df['income'] == '>50K')].groupby('education-num').size() / df[df['sex'] == 'Female'].groupby('education-num').size() * 100"
    },
    {
        "question": "What are the top 5 native countries with the highest average age of individuals earning over $50K?",
        "query": "result = df[df['income'] == '>50K'].groupby('native-country')['age'].mean().nlargest(5)"
    },
    {
        "question": "For each occupation, calculate the difference between the highest and lowest hours-per-week worked.",
        "query": "result = df.groupby('occupation')['hours-per-week'].max() - df.groupby('occupation')['hours-per-week'].min()"
    },
    {
        "question": "Which combination of race and sex has the highest average capital loss, and what is that amount?",
        "query": "result = df.groupby(['race', 'sex'])['capital-loss'].mean().idxmax(), df.groupby(['race', 'sex'])['capital-loss'].mean().max()"
    }
]

